import React from "react"

function Nav() {
    return (
        <nav className="nav">
            <div className="logo-box">
                <a href="/">
                    <img alt="vgrade logo" className="logo" src="./images/vgrade-logo.png"></img>
                </a>
            </div>
        </nav>
    );
}

export default Nav;
